ITIL Foundation:

Now a days ITIL-2011 Syllabus is running..but it has very little difference comapare to previous versions.

To get 100% :

1. ITIL_V3_Study_Guide - Read it thoroughly.

2. EX0-101 (Q&amp;A-291 Nos) - Try it with 100% correctly.

3. EX0-117 (Q&amp;A-80 Nos) &amp; EX0-117 (Q&amp;A-75 Nos) - Give a Self-Test for these 2 sets Q &amp; A.

Best of Luck..

